            {id: 1, name: 'Camisa JS', precio: 30},
            {id: 1, name: 'Camisa DOM', precio: 30},
        ]
    }


    render() {

        const {productos} = this.state;
        console.log(productos);
        return ( 
            <h1>Lista de productos</h1>
        );
    }
}


